import React from "react";

export default function ContentTeam({ type, data }) {
    return (
        <div>
            {type === "results" && <p>Zde budou výsledky týmu.</p>}
            {type === "program" && <p>Zde bude program zápasů.</p>}
            {type === "lineUp" && <p>Zde bude soupiska týmu.</p>}
        </div>
    );
}
